import React from "react";
import "./Header.css";

const Header = props => (

<div className="Navbar">
<div className="row">
<div className="header">


<div className="col">
<div className="title">{props.children}</div>
</div>

<div className="col">
<div className="scores">Score: {props.score} Highscore: {props.highscore}</div>
</div>

</div>
</div>
</div>
);

export default Header;
